#
# TABLE STRUCTURE FOR: absensi
#

DROP TABLE IF EXISTS `absensi`;

CREATE TABLE `absensi` (
  `id_absensi` int(11) NOT NULL AUTO_INCREMENT,
  `id_devices` int(11) DEFAULT NULL,
  `id_siswa` int(11) DEFAULT NULL,
  `keterangan` varchar(20) NOT NULL,
  `foto` mediumtext NOT NULL,
  `created_at` int(11) NOT NULL,
  PRIMARY KEY (`id_absensi`)
) ENGINE=InnoDB AUTO_INCREMENT=4605 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: devices
#

DROP TABLE IF EXISTS `devices`;

CREATE TABLE `devices` (
  `id_devices` int(11) NOT NULL AUTO_INCREMENT,
  `nama_devices` varchar(100) NOT NULL,
  `mode` varchar(10) NOT NULL,
  PRIMARY KEY (`id_devices`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: histori
#

DROP TABLE IF EXISTS `histori`;

CREATE TABLE `histori` (
  `id_histori` int(11) NOT NULL AUTO_INCREMENT,
  `id_siswa` int(11) NOT NULL,
  `id_devices` int(11) NOT NULL,
  `keterangan` varchar(100) NOT NULL,
  `waktu` int(11) NOT NULL,
  PRIMARY KEY (`id_histori`)
) ENGINE=InnoDB AUTO_INCREMENT=4800 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: kampus
#

DROP TABLE IF EXISTS `kampus`;

CREATE TABLE `kampus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `kampus` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: kelas
#

DROP TABLE IF EXISTS `kelas`;

CREATE TABLE `kelas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `kelas` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: siswa
#

DROP TABLE IF EXISTS `siswa`;

CREATE TABLE `siswa` (
  `id_siswa` int(11) NOT NULL AUTO_INCREMENT,
  `id_devices` int(11) NOT NULL,
  `nis` varchar(50) DEFAULT NULL,
  `uid` varchar(100) DEFAULT NULL,
  `id_kelas` int(11) DEFAULT NULL,
  `id_kampus` int(11) DEFAULT NULL,
  `nama` varchar(100) DEFAULT NULL,
  `telp` varchar(20) DEFAULT NULL,
  `gender` varchar(20) DEFAULT NULL,
  `alamat` varchar(200) DEFAULT NULL,
  `foto` varchar(255) NOT NULL,
  `ttl` varchar(255) DEFAULT NULL,
  `nisn` varchar(255) DEFAULT NULL,
  `nik` varchar(255) NOT NULL,
  PRIMARY KEY (`id_siswa`)
) ENGINE=InnoDB AUTO_INCREMENT=499 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: secret_key
#

DROP TABLE IF EXISTS `secret_key`;

CREATE TABLE `secret_key` (
  `id_key` int(11) NOT NULL,
  `key` varchar(100) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: user
#

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id_user` int(11) NOT NULL,
  `nama` varchar(50) NOT NULL,
  `email` varchar(50) NOT NULL,
  `username` varchar(30) NOT NULL,
  `password` varchar(100) NOT NULL,
  `avatar` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: waktu_operasional
#

DROP TABLE IF EXISTS `waktu_operasional`;

CREATE TABLE `waktu_operasional` (
  `id_waktu_operasional` int(11) NOT NULL AUTO_INCREMENT,
  `waktu_operasional` varchar(20) NOT NULL,
  `keterangan` varchar(20) NOT NULL,
  `day` varchar(10) NOT NULL,
  PRIMARY KEY (`id_waktu_operasional`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;



#
# TABLE STRUCTURE FOR: walikelas
#

DROP TABLE IF EXISTS `walikelas`;

CREATE TABLE `walikelas` (
  `id_walikelas` int(3) NOT NULL AUTO_INCREMENT,
  `no` text NOT NULL,
  `nama` varchar(225) NOT NULL,
  `password` varchar(100) NOT NULL,
  `nuptk` varchar(255) NOT NULL,
  `kelas` int(3) NOT NULL,
  `avatar` varchar(225) NOT NULL,
  PRIMARY KEY (`id_walikelas`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



